import React from 'react'

export default function NewTweet() {
    return (
        <div className='container'>
            <div className="input-field col s12 center">
                <textarea id="textarea2" rows='12' placeholder='Type anything' class="materialize-textarea" data-length="120"></textarea>
            </div>
            <a class="waves-effect waves-light btn right">Tweet</a>
        </div>
    )
}
